export default function Email() {
    return (
        <div className="emailform" style={{ backgroundColor: 'rgb(244, 247, 246)', maxWidth: '590px', margin: '20px auto', fontFamily: 'arial', lineHeight: 3, height: '500px' }}><div className="inner" style={{ padding: '50px' }}><div className="logo"><img src="img/logo.svg" style={{ width: '100px', marginBottom: '10px' }} /></div><div className="content"><h2>Đăng ký khóa học tại CFD.</h2><p>Chào mừng tân binh <strong>Trần Nghĩa</strong>,</p><p>Bạn đã đăng ký khóa học <a href="#" target="_blank" style={{ textDecoration: 'none', color: 'rgb(0, 175, 171)' }}><strong>CFD2 Căn Bản</strong></a> tại <strong>CFD</strong> thành công, chúng tôi sẽ chủ động liên hệ thông qua số điện thoại của bạn.</p><a href="#" target="_blank" className="btn" style={{ backgroundColor: 'rgb(0, 175, 171)', borderRadius: '50px', padding: '10px 20px', display: 'inline-flex', alignItems: 'center', justifyContent: 'center', color: 'rgb(255, 255, 255)', fontWeight: 'bold', textDecoration: 'none', textTransform: 'uppercase', fontSize: '14px', marginTop: '20px' }}>Trang chủ CFD</a></div></div><div className="bottom" style={{ fontSize: '13px', background: 'rgb(221, 221, 221)', padding: '30px 50px', color: 'rgb(118, 118, 118)' }}><p style={{ margin: '0px 0px 2px' }}>Đây là email được gửi từ hệ thống CFD.</p><p style={{ margin: '0px 0px 2px' }}>Vui lòng không trả lời trực tiếp qua email này.</p><p style={{ margin: '0px' }}>Văn phòng CFD, số 11, Phan Kế Bính, Đa Kao, Quận 1, TP Hồ Chí Minh, Việt Nam.</p></div></div>
    )
}
